								<div class="elementor-element elementor-element-52d8311f animated-slow elementor-invisible elementor-widget elementor-widget-heading" data-id="52d8311f" data-element_type="widget" data-settings="{&quot;_animation&quot;:&quot;fadeIn&quot;}" data-widget_type="heading.default">
				<div class="elementor-widget-container">
			<h3 class="elementor-heading-title elementor-size-default">Kok Bisa Klaster Nayanika Menghemat Hingga Rp 129 Juta Rupiah ?</h3>		</div>
				</div>
				<div class="elementor-element elementor-element-630c3619 elementor-invisible elementor-widget elementor-widget-text-editor" data-id="630c3619" data-element_type="widget" data-settings="{&quot;_animation&quot;:&quot;fadeIn&quot;,&quot;_animation_delay&quot;:200}" data-widget_type="text-editor.default">
				<div class="elementor-widget-container">
							<p>Mari kita bandingkan antara membeli rumah tipe 36/72 (standar) di daerah Setu dan membeli kavling siap bangun di KLASTER NAYANIKA dengan asumsi tipe yang sama persis dengan rumah jadi tersebut.</p>						</div>
				</div>
					</div>
		</div>
